import React from "react";

import { Box } from "@mui/material";

import { navData } from "../../constants/data";

const NavBar = () => {
  return (
    <Box>
      {navData.map((data, id) => (
        <Box key={id}>
          <img src={data.url} alt={"nav"}></img>
          <p>{data.text}</p>
        </Box>
      ))}
    </Box>
  );
};

export default NavBar;
